		Name: "Small Yellow House",
		AlternativeNames: ["None"],
		DisplayedText: "I's a yellow house with mossy shingles and old, wooden siding. The dying yard is full of small, shallow holes.|There's no doorbell, just a few crumbling steps leading up to the door.|-----|I step up to the white front door. There's a mail slot on it.|-----|It's locked.|-----|This old-fashioned mail slot is like a doggy door but only tall enough for a piece of paper.|I kneel down and manage to fit my hand through.|-----|I feel a massive pile of paper and envelopes. My hand can't reach to the bottom of it.|-----|I feel the doorknob.|-----|I twist the knob, but it doesn't turn all the way.|-----|A cold hand clasps around mine. \"A mail thief!\"|-----|He holds on tight so I can't wrench my ar out of the mail slot. \"I forgive you. What do you want?\"|-----|Well, clearly, you must want in. I'd love some company.|-----|He lets go of my hand. \"Ah, great!\" he says. I stand up, and the door opens. It's a lanky guy in a wrinkled, white, plaid dress shirt and black shorts. I think he cut his own hair. \"Come on, it looks hot out there!\"|-----|I follow him through a carpeted hallway. There are shopping bags all over the floor and empty take-out food boxes, so there's almost nowhere to step.|-----|We find ourselves in a di living room where a small, tube television is set against the shuttered window. The floor is covered in junk. He scoots a heap of food wrappers and empty, plastic cups off the couch and offers me to sit.|-----|As I sit, I hear a crunch under the couch cushion. \"Aha!\" He pulls the remote out from a stack of pizza boxes on the floor.|Then he switches the TV on, but the screen is just displaying colored bars and a dull tone. \"Oh right, antenna's still bent. Just gotta pop a movie in! I know there's one around here...\"|-----|I open the top one. There's a wad of used tissues, some straw wrappers, and an untouched plate of refried beans and nachos. \"Gosh, that must have been there for days,\" he says as he reaches his arm into a trash bag. \"Can't eat it now. Just have to throw it away...\"|-----|I shut the pizza box.|-----|A bunch of colorful boxes whir motonously|-----|I get off the couch. Charlie jumps up ad says, \"Oh! Almost forgot about something. Now that I have a visitor, I can finally show someone!\" Then he hurries into the kitchen.|-----|There's several trash cans around the small kitchen, but they can't hold the enormous mess. The counter is lined with cleaning chemicals among food cans, empty cartons, and a juice pitcher coated with dust. He's sifting through the garbage, looking for something.|-----|\"Oh, oh, there he is!\" He stand up, cupping something in his hands.|-----|The man steps up to me and almost trips. In his hands something black and shiny squirms and jumps around. \"It's only just big enough to hold in the palm of your hand,\" he says.|-----|\"It's a hippo. I mean, just like the ones on the animal channel!\"|He's right. It's a shiny, black hippo.|-----|\"I don't know. Maybe it's a new species.\" He pokes it with his finger and plays with it as it jumps around.|-----|\"I dug it up out of the ground, with my shovel. That's where I've found all this stuff, everything here! But this--this is better than digging up a million dollars.\"|-----|\"I know it sounds crazy! I'm like the luckiest man on Earth. I can't explain it. Stuff just pops out of the dirt as I'm digging down. I mean, have you tried it? You can get so much stuff!\"|-----|\"Well, let me think. Long ago, I was digging a... well anyway, then I found Butter. Butter! Butter, she saved me. The cutest ears and weasly little snout, longest whiskers.\" He looks up with a smile, his eyes closed.",
